spica_rate_t cmis_f16_to_float(uint16_t value)
{
    if(0 == value)
    {
        return 0;
    }
    if(0 == F16_MAN_GET(value))
    {
        //not-a-number
        return NAN;
    }
    if(0xffff == value)
    {
        //infinity
        return INFINITY;
    }

    spica_rate_t ret = F16_MAN_GET(value);
    //true exponent, unbiased
    int _exp = F16_EXP_GET(value);

    while(_exp > 0)
    {
        ret *= 10.0;
        _exp -= 1;
    }
    while(_exp < 0)
    {
        ret /= 10.0;
        _exp += 1;
    }
    return ret;
}

